Result also comes with some methods for working with the error we receive. Most notably, errors can be mapped with mapErr. const erroredParse = parseInt("foo") .mapErr(errorMessage => { return "Oops, we couldn't parse that value!" }) This can become very useful when we have much more complex return types enum MathError { DivisionByZero, NonPositiveLogarithm, NegativeSquareRoot
} type MathResult = Result<number, MathError>; function div(x: number, y: number): MathResult { if (y === 0) { return Err(MathError.DivisionByZero); } else { return Ok(x / y); }
} function ln(x: number): MathResult { if (x < 0) { return Err(MathError.NonPositiveLogarithm); } else { return Ok(Math.log10(x)) }
} function sqrt(x: number): MathResult { if (x < 0) { return Err(MathError.NegativeSquareRoot); } else { return Ok(Math.sqrt(x)); }
} In each of these instances, our error could be one of the enum MathError. This means we can tailor how we handle the error accordingly. div(1, 0) .mapErr(err => { if (err === MathError.DivisionByZero) { throw new Error("You attempted to divide by zero!") } }); ln(-1) .mapErr(err => { if (err === MathError.NonPositiveLogarithm) { throw new Error("Natural log is not defined for values less than 0"); } }); sqrt(-1) .mapErr(err => { if (err === MathError.NegativeSquareRoot) { throw new Error("The square root of a negative number is imaginary" ) } })

